"use strict";

var base64 = require('base64-stream');
var stringStream = require('string-stream');

// retreived via:
var pictureData = {
  // w:204 h:204, jpeg
  CAT_1: "",

  // w:415 h:480, jpeg
  CAT_2: "",

  // w:500 h:449, jpeg
  CAT_3: "",

  // TIF
  CAT_TIF: ""
};


module.exports = {
  getCatPicStream: function(path)  {
    var catStringStream;
    if(path.match(/CAT_TIF/g)) {
	    catStringStream = new stringStream(pictureData.CAT_TIF);
    }
    else if(path.match(/CAT_3/g)) {
	    catStringStream = new stringStream(pictureData.CAT_3);
    }
    else if (path.match(/CAT_2/g)) {
	    catStringStream = new stringStream(pictureData.CAT_2);
    }
    else {
	    catStringStream = new stringStream(pictureData.CAT_1);
    }

    return catStringStream.pipe(base64.decode());
  }
};

